function getIconSVG(iconName, width = 20, height = 20, style = "") {
  const svg = iconSVGs[iconName];
  if (!svg) { console.warn("Icon not found:", iconName); return "<svg></svg>"; }
  let modified = svg;
  if (modified.includes("width=")) {
    modified = modified.replace(/width="[^"]*"/, "width=\"" + width + "\"");
  } else {
    modified = modified.replace("<svg", "<svg width=\"" + width + "\"");
  }
  if (modified.includes("height=")) {
    modified = modified.replace(/height="[^"]*"/, "height=\"" + height + "\"");
  } else {
    modified = modified.replace("<svg", "<svg height=\"" + height + "\"");
  }
  const baseStyle = "display:inline-block;vertical-align:middle;";
  const fullStyle = style ? baseStyle + style : baseStyle;
  if (modified.includes("style=")) {
    modified = modified.replace(/style="([^"]*)"/, "style=\"" + fullStyle + ";$1\"");
  } else {
    modified = modified.replace("<svg", "<svg style=\"" + fullStyle + "\"");
  }
  return modified;
}
